import React from 'react';
import { Card, CardContent, CardHeader, CardTitle } from '@/components/ui/card';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

// Define types for our data
type PetGroup = {
  name: string;
  adopted: number;
  remaining: number;
  image: string;
};

type RevenueData = {
  month: string;
  revenue: number;
};

// Hardcoded data
const petGroups: PetGroup[] = [
  { name: 'Dogs', adopted: 45, remaining: 15, image: '/api/placeholder/100/100' },
  { name: 'Cats', adopted: 30, remaining: 20, image: '/api/placeholder/100/100' },
  { name: 'Birds', adopted: 15, remaining: 25, image: '/api/placeholder/100/100' },
  { name: 'Rabbits', adopted: 10, remaining: 10, image: '/api/placeholder/100/100' },
];

const revenueData: RevenueData[] = [
  { month: 'Jan', revenue: 5000 },
  { month: 'Feb', revenue: 7000 },
  { month: 'Mar', revenue: 6000 },
  { month: 'Apr', revenue: 8000 },
  { month: 'May', revenue: 9000 },
  { month: 'Jun', revenue: 10000 },
];

const totalRevenue = revenueData.reduce((sum, month) => sum + month.revenue, 0);
const totalAdopted = petGroups.reduce((sum, group) => sum + group.adopted, 0);

export const AdminDashboard: React.FC = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-6">Admin Dashboard</h1>
      
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-6">
        <Card>
          <CardHeader>
            <CardTitle>Total Adoptions</CardTitle>
          </CardHeader>
          <CardContent>
            <p className="text-4xl font-bold">{totalAdopted}</p>
          </CardContent>
        </Card>
        <Card>
          <CardHeader>
            <CardTitle>Total Revenue</CardTitle>
          </CardHeader>
          <CardContent>
            <p className="text-4xl font-bold">${totalRevenue.toLocaleString()}</p>
          </CardContent>
        </Card>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-6">
        {petGroups.map((group) => (
          <Card key={group.name}>
            <CardContent className="flex items-center p-6">
              <img src={group.image} alt={group.name} className="w-24 h-24 object-cover rounded-full mr-6" />
              <div>
                <h3 className="text-xl font-semibold mb-2">{group.name}</h3>
                <p>Adopted: {group.adopted}</p>
                <p>Remaining: {group.remaining}</p>
              </div>
            </CardContent>
          </Card>
        ))}
      </div>

      <Card className="mb-6">
        <CardHeader>
          <CardTitle>Monthly Revenue</CardTitle>
        </CardHeader>
        <CardContent>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={revenueData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="month" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="revenue" fill="#8884d8" />
            </BarChart>
          </ResponsiveContainer>
        </CardContent>
      </Card>
    </div>
  );
};
